    "img": "residence/West_College_1.jpg",
    "description": "<p>WestCo seeks to embody a respectful community where residents pursue group initiatives based on the interest of its residents and provide an atmosphere of tolerance, encouragement, and activity. WestCo welcomes a wide spectrum of backgrounds and experiences that help contribute to the environment.</p><p>Residents are expected to take an active role in shaping the social, intellectual and living environment of WestCo, continuing a longstanding tradition of self-governance and activism. Self-governance is manifested in the community holding one another accountable to shared values and to goals that are continually evaluated. WestCo is held responsible to the larger community, while the University reciprocates with a commitment to a collaborative relationship. Through Guidance, a weekly meeting open to the entire Westco, residents are encouraged to be involved in the community and the University. In the past, residents have organized music and arts events, lifestyle festivals, and informal education projects reflecting a commitment to a vibrant, expressive and socially conscious residential experience. WestCo welcomes all students who will actively contribute to the community and work for these goals.</p><p>WestCo is centrally located on campus and is connected to WEShop. In WestCo, residents live in doubles and singles gathered around a courtyard. It is also home to the unique student-run WestCo Caf, a venue for various events situated under WestCo 3.</p><p>Applications are not necessary for incoming first year students.</p>",
